import React from 'react'
import GitHubIcon from '@mui/icons-material/GitHub';
import './Copyright.css'

export default function Copyright() {
  return (
    <div className='last-container'>
        <div className='github-last-icon'>
            <GitHubIcon />
        </div>
    </div>
  )
}
